import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Nav extends Component{
    render(){
        return <div className="nav container-fluid">
                <a className="col-4"><Link to={"/"}>Home</Link></a>
                <a className="col-4"><Link to={"/Tasks"}>Tasks</Link></a>
                <a className="col-4"><Link to={"/Posts"}>Posts</Link></a>
              </div>
    }
}

export default Nav
